import { useState } from "react";
import { NoteState } from "./task_list_note";

export interface taskListProps {
    onAdd: () => void;

}

export const TaskList = () => {

    const [taskListNotes, SetTaskListNotes] = useState(NoteState)
    const [noteName,setNoteName] = useState('')
    const [noteText,setNotetext] = useState('')
    const [modalOpen,setModalOpen] = useState(false)

    const onAdd = () => {
        const newNotes = taskListNotes.push({
            id:taskListNotes.length + 1,
            name:'gg',
            text:'gggg'})
    }

    return (
        <div className="task-list">
            <button className="add_button">
                <h1 onClick={onAdd}>
                    +
                </h1>
            </button>
            <div className="task-list-body">
                {taskListNotes.map((note) =>
                    <div className="task-list-note">
                        <div className="note-head">
                            <div className="note-id">
                                {note.id}
                            </div>
                            <div className="note-name">
                                <h2>
                                    {note.name}
                                </h2>
                            </div>
                        </div>
                        <div className="note-text">
                            <h3>
                                {note.text}
                            </h3>
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
};
